import React from 'react';

class Rows extends React.Component {
    constructor(props) {
        super(props); 
    }

    sortByArtist() {
        return (<div>Sort By Artist</div>);
    }

    sortByVenue() {
        return (<div>Sort By Venue</div>); 
    }

    render() {
        if (this.props.optionSelected === 'Artist') {
            // Sort by Artist 
            return sortByArtist(); 
        }
        else if (this.props.optionSelected === 'Venue') {
            return sortByVenue(); 
        }
        return (
            <div>
                {this.props.optionSelected}
            </div>
        );
    }
     
}

export default Rows;
